import { Table } from 'reactstrap';
import classes from './Dashboard.module.css';

const USER_DATA = [
    { 'ID': 1, 'name': 'Prasad', 'email': 'pn@test.com', 'status': 'Active' },
    { 'ID': 2, 'name': 'Nikita', 'email': 'np@gamil.com', 'status': 'Pending' }
];

const Dashboard = () => {
    return (
        <>
            {/* <h3>Hello </h3> */}
            <Table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Username</th>
                        <th>Email</th>
                        <th>Status</th>
                    </tr>
                </thead>
                <tbody>
                    {USER_DATA.map((el) => {
                        return <tr>
                            <td>{el.ID}</td>
                            <td>{el.name}</td>
                        </tr>
                    })}
                    
                    <tr>
                        <td>2</td>
                        <td>Bob</td>
                        <td>bob@email.com</td>
                        <td>
                            <span className="py-0 px-1 bg-warning rounded text-white">delayed</span>
                        </td>
                    </tr>

                </tbody>
            </Table>
        </>
    );
}

export default Dashboard;
